import React from 'react';

const ScorecardTab = ({ scoreboards = [], batting = [], bowling = [], localteam, visitorteam }) => {
  // Group batting by scoreboard
  const groupByInnings = (list) => {
    return list.reduce((acc, item) => {
      const key = item.scoreboard;
      if (!acc[key]) acc[key] = [];
      acc[key].push(item);
      return acc;
    }, {});
  };

  const battingByInnings = groupByInnings(batting);
  const bowlingByInnings = groupByInnings(bowling);

  const getTeamName = (teamId) => {
    if (localteam?.id === teamId) return localteam.name;
    if (visitorteam?.id === teamId) return visitorteam.name;
    return 'Unknown';
  };

  return (
    <div>
      <h3>Scorecard</h3>
      {scoreboards.map((sb, index) => {
        const teamName = getTeamName(sb.team_id);
        const scoreboardKey = sb.scoreboard;

        const thisInningBatting = battingByInnings[scoreboardKey] || [];
        const thisInningBowling = bowlingByInnings[scoreboardKey] || [];

        return (
          <div key={index} style={{ marginBottom: '40px' }}>
            <h4>{teamName} - Innings {scoreboardKey}</h4>

            <table border="1" cellPadding="5" cellSpacing="0" width="100%">
              <thead>
                <tr>
                  <th>Batsman</th>
                  <th>R</th>
                  <th>B</th>
                  <th>4s</th>
                  <th>6s</th>
                  <th>SR</th>
                  <th>How Out</th>
                </tr>
              </thead>
              <tbody>
                {thisInningBatting.map((batsman, i) => (
                  <tr key={i}>
                    <td>{batsman.batsman?.fullname || batsman.batsman?.display_name || '—'}</td>
                    <td>{batsman.score}</td>
                    <td>{batsman.ball}</td>
                    <td>{batsman.four}</td>
                    <td>{batsman.six}</td>
                    <td>{batsman.rate}</td>
                    <td>{batsman.result?.name || 'Not Out'}</td>
                  </tr>
                ))}
              </tbody>
            </table>

            <h5 style={{ marginTop: '20px' }}>Bowling</h5>
            <table border="1" cellPadding="5" cellSpacing="0" width="100%">
              <thead>
                <tr>
                  <th>Bowler</th>
                  <th>O</th>
                  <th>M</th>
                  <th>R</th>
                  <th>W</th>
                  <th>Econ</th>
                </tr>
              </thead>
              <tbody>
                {thisInningBowling.map((bowler, i) => (
                  <tr key={i}>
                    <td>{bowler.bowler?.fullname || '—'}</td>
                    <td>{bowler.overs}</td>
                    <td>{bowler.medians}</td>
                    <td>{bowler.runs}</td>
                    <td>{bowler.wickets}</td>
                    <td>{bowler.rate}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        );
      })}
    </div>
  );
};

export default ScorecardTab;
